import React from 'react';
import { Link, Route } from 'react-router-dom';
import './Header-wrapper.scss'

const HeaderTop = () => {
    return (
        <Route>
            <div className="header-top">
            <ul>
                <li>
                    <Link to={'#'}>Đăng nhập</Link>
                </li>
                <li>
                    <Link to={'#'}>Đăng ký</Link>
                </li>
                <li>
                    <a>Đăng Xuất</a>
                </li>
                <li>
                    <a><i className="fa fa-user" aria-hidden="true"></i>Tài khoản</a>
                </li>
                <li>
                    <a><i className="fa fa-heart" aria-hidden="true"></i>Sản phẩm yêu thích</a>
                </li>
            </ul>
        </div>
        </Route>
        
    );
};

export default HeaderTop;
